[Form]
public class EcoResProductParameters extends FormRun
{
    NumberSeqReference          numberSeqReferenceProduct;

    boolean                     runExecuteDirect;
    boolean                     runExecuteDirectCompany;
    TmpIdRef                    tmpIdRef;
    TmpIdRef                    tmpIdRefCompany;
    NumberSeqScope              scope;
    NumberSeqScope              scopeCompany;
    NumberSeqApplicationModule  numberSeqApplicationModule;
    NumberSeqApplicationModule  numberSeqApplicationModuleCompany;
    container                   numberSequenceModules;
    private UserId              currentUserId;
    container                   numberSequenceModulesCompany;

    private boolean             isCompanyNumberSequenceFeatureEnabled;
    private boolean             isSpecificFallbackLanguageFeatureEnabled;

}

    public void init()
    {
		isCompanyNumberSequenceFeatureEnabled = EcoResProductParametersCompanyNumSeqFeature::isFeatureEnabled();
        isSpecificFallbackLanguageFeatureEnabled = FeatureStateProvider::isFeatureEnabled(EcoResProductTranslationFallbackSpecificLanguageFeature::instance());
        this.numberSeqPreInit();  

        if (isSpecificFallbackLanguageFeatureEnabled)
        {
            currentUserId = curUserId();
            EcoResProductParametersFallbackLanguage fallbackLanguage;

            select firstonly fallbackLanguage where fallbackLanguage.UserId == currentUserId;
            if (!fallbackLanguage)
            {
                fallbackLanguage.LanguageId = SystemParameters::getSystemLanguageId();
                fallbackLanguage.UserId = currentUserId;
                fallbackLanguage.insert();
            }
        }

        super();

        EcoResProductParameters::find();

        this.numberSeqPostInit();

        this.updateDesign();
    }

public void updateDesign()
{
    EcoResProductParameters_PriceBreakdownDocuTypeId.enabled(EcoResProductParameters.IsPriceBreakdownEnabled);

    EcoResProductParametersFallbackLanguage_LanguageId.enabled(EcoResProductParameters.UseFallbackTranslation && !EcoResProductParametersFallbackLanguage.UseUserLanguage);
    EcoResProductParametersFallbackLanguage_UseUserLanguage.enabled(EcoResProductParameters.UseFallbackTranslation);

    if (isSpecificFallbackLanguageFeatureEnabled)
    {
        EcoResProductParameters_UseFallbackTranslation.label("@SCM:EcoResProductParametersSpecificLanguageEnabled");
        EcoResProductParameters_UseFallbackTranslation.helpText("@SCM:EcoResProductParametersSpecificLanguageEnabledHelpText");

        ProductDisplayLanguage.moveControl(EcoResProductParameters_UseFallbackTranslation.id());
        ProductDisplayLanguage.visible(NoYes::Yes);
    }
    else
    {
        ProductDisplayLanguage.visible(NoYes::No);
    }

    if (isCompanyNumberSequenceFeatureEnabled)
    {
        TabNumberSeq.caption("@SCM:Tab_EcoResProductParameters_SharedNumberSequences");
        TabNumberSeqCompany.visible(true);
    }
    else
    {
        NumberSequenceReferenceCompany_ds.queryBuildDataSource().enabled(false);
    }
}

void numberSeqPostInit()
{
    numberSequenceReference_ds.object(fieldNum(NumberSequenceReference, AllowSameAs)).visible(numberSeqApplicationModule.sameAsActive());
    sameAsLabel.visible(numberSeqApplicationModule.sameAsActive());

    if (isCompanyNumberSequenceFeatureEnabled)
    {
        numberSequenceReferenceCompany_ds.object(fieldNum(NumberSequenceReference, AllowSameAs)).visible(numberSeqApplicationModuleCompany.sameAsActive());
        sameAsLabelCompany.visible(numberSeqApplicationModuleCompany.sameAsActive());
    }
}

void numberSeqPreInit()
{
    runExecuteDirect            = false;
    numberSequenceModules       = [NumberSeqModule::EcoResProduct];
    numberSeqApplicationModule  = new NumberSeqModuleEcoResProduct();
    scope                       = NumberSeqScopeFactory::createGlobalScope();

    NumberSeqApplicationModule::createReferencesMulti(numberSequenceModules, scope);

    tmpIdRef.setTmpData(NumberSequenceReference::configurationKeyTableMulti(numberSequenceModules));

    if (isCompanyNumberSequenceFeatureEnabled)
    {
        runExecuteDirectCompany = false;
        numberSequenceModulesCompany = [NumberSeqModule::EcoResProduct];
        numberSeqApplicationModuleCompany  = new NumberSeqModuleEcoResProduct();
        scopeCompany = NumberSeqScopeFactory::createDataAreaScope();
        NumberSeqApplicationModule::createReferencesMulti(numberSequenceModulesCompany, scopeCompany);
        tmpIdRefCompany.setTmpData(NumberSequenceReference::configurationKeyTableMulti(numberSequenceModulesCompany));
    }
}

public int active()
{
    int ret = super();

    element.updateDesign();

    return ret;
}

public void modified()
{
    super();

    EcoResProductParameters_PriceBreakdownDocuTypeId.enabled(EcoResProductParameters.IsPriceBreakdownEnabled);

    EcoResProductParameters.defaultPriceBreakdownDocuType();
}

public void init()
{
    super();
    //cache display methods to limit server calls
    numberSequenceReference_ds.cacheAddMethod(tableMethodStr(NumberSequenceReference, referenceLabel));
    numberSequenceReference_ds.cacheAddMethod(tableMethodStr(NumberSequenceReference, referenceHelp));
}

void removeFilter()
{
    runExecuteDirect = false;
    numbersequenceReference_ds.executeQuery();
}

void executeQuery()
{
    if (runExecuteDirect)
    {
        super();
    }
    else
    {
        runExecuteDirect = true;
        this.queryRun(NumberSeqReference::buildQueryRunMulti(numberSequenceReference,
                                                             tmpIdRef,
                                                             numberSequenceTable,
                                                             numberSequenceModules,
                                                             scope));
        numbersequenceReference_ds.research();
    }
}

public Common resolveReference(FormReferenceControl _formReferenceControl)
{
    NumberSequenceCode code = _formReferenceControl.filterValue(
        AbsoluteFieldBinding::construct(fieldStr(NumberSequenceTable, NumberSequence),
        tableStr(NumberSequenceTable))).value();

    // Do not call super as we're providing our own disambiguation logic.
    // resolvedRecord = super(_formReferenceControl);

    return NumberSequenceTable::findByNaturalKey(code, scope.getId(true));
}

public Common lookupReference(FormReferenceControl _formReferenceControl)
{
    NumberSequenceTable     selectedRecord;
    SysReferenceTableLookup sysTableLookup = SysReferenceTableLookup::newParameters(tableNum(NumberSequenceTable), _formReferenceControl, true);
    Query lookupQuery;

    // Do not call super as we're providing our own custom lookup logic.
    // selectedRecord = super(_formReferenceControl);

    // Display the Title and Department fields in the lookup form.
    sysTableLookup.addLookupfield(fieldNum(NumberSequenceTable, NumberSequence));

    // Create a custom Query that filters on NumberSequenceScope.
    lookupQuery = new Query();
    lookupQuery.addDataSource(tableNum(NumberSequenceTable)).addRange(fieldNum(NumberSequenceTable, NumberSequenceScope)).value(queryValue(scope.getId(true)));
    sysTableLookup.parmQuery(lookupQuery);

    // Return the record selected by the user.
    selectedRecord = sysTableLookup.performFormLookup();

    return selectedRecord;
}

