            this.queryRun(NumberSeqReference::buildQueryRunMulti(numberSequenceReferenceCompany,
                                                             tmpIdRefCompany,
                                                             numberSequenceTableCompany,
                                                             numberSequenceModulesCompany,
                                                             scopeCompany));
            numbersequenceReferenceCompany_ds.research();
        }
    }
}

