public void clicked()
{
    super();

    EcoResProductParametersFallbackLanguage_LanguageId.enabled(EcoResProductParameters.UseFallbackTranslation && !EcoResProductParametersFallbackLanguage.UseUserLanguage);
    EcoResProductParametersFallbackLanguage_UseUserLanguage.enabled(EcoResProductParameters.UseFallbackTranslation);
}

public void clicked()
{
    super();

    EcoResProductParametersFallbackLanguage_LanguageId.enabled(!EcoResProductParametersFallbackLanguage.UseUserLanguage);

    if (EcoResProductParametersFallbackLanguage.UseUserLanguage)
    {
        EcoResProductParametersFallbackLanguage.LanguageId = '';
    }
    else
    {
        EcoResProductParametersFallbackLanguage.LanguageId = currentUserLanguage();
    }

    EcoResProductParametersFallbackLanguage_ds.refresh();
}

